const ref = document.getElementById('cite_note-12');
JSON.stringify({
    fullText: ref ? ref.innerText : 'not found',
    links: ref ? [...ref.querySelectorAll('a')].map(a => ({
        href: a.href,
        text: a.innerText.trim()
    })) : []
});

const markers = document.querySelectorAll('sup a[href="#cite_note-12"]');
const results = [];
for (let marker of markers) {
    let el = marker;
    for (let i = 0; i < 5; i++) {
        if (el.tagName === 'P' || el.tagName === 'LI') break;
        el = el.parentElement;
    }
    results.push(el ? el.innerText.substring(0, 800) : 'not found');
}
JSON.stringify(results);
